Playboys Yoga with Sara Jean Underwood
English | 307.23 MB

Playboys 2007 Playmate of the Year Sara Jean Underwood is a dedicated yoga enthusiast. She demonstrates some of the yoga poses that keep her body in such good shape.

The Recent Cyber Club Playmate feature with 2007 Playmate of the Year Sara Jean Underwood conducting thirteen separate yoga poses. All thirteen high-definition Quicktime videos and accompanying screen shots are included.
